import './App.css';
import IconColumn from './Components/IconColumn.jsx'
import NavBar from './Components/NavBar.jsx'
import { library } from '@fortawesome/fontawesome-svg-core';
import { fas } from '@fortawesome/free-solid-svg-icons';

library.add(fas);

function App() {
  return (
    <div class="flex flex-col justify-between h-screen w-screen bg-black">
      <IconColumn />
      <NavBar />
    </div>
  );
}

export default App;
